import React, { Component } from 'react'
import "../../Css/EditProfile.css";

export default class EditProfile extends Component {
     constructor(){
         super();
             this.state = {
                 name: '',
                 phone: '',
                 profession:'',
                 hourlyRate:'',
                 availibilty:'',
                 age:'',
                 address:'',
                 experience:'',
                 github:'',
                 behance:'',
                 facebook:'',
                 linkedin:'',
                 instagram:'',
                 portfolio:'',
                 photo:'',
                 cv:'',
                 certficates:'',
                 descrption:'',
                 languages:'',
                 skills:''


             };
         this.onChange = this.onChange.bind(this);
         this.onSubmit = this.onSubmit.bind(this);

     }
    //  componentWillReceiveProps(nextProps){
    //         if(nextProps.errors){
    //             this.setState({
    //                 errors: nextProps.errors
    //             });
    //         }
    //  }
     onChange(e){
         this.setState({[e.target.name]: e.target.value});
     }
      onSubmit(e){
         e.preventDefault();

       
     }
    render() {
        return (
            <div className="editProfile">
                <div className="navName">
                    <h4>Edit Profile</h4>
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quos, quaerat eaque. Harum sunt explicabo quam minima veniam possimus odit officiis?</p>
                </div>
                <hr/>
                <div className="editProfile_body">
                     <form onSubmit={this.onSubmit}>
                       <div className="col1">
                                                            <h5>Name</h5>
                                                    <input type='text'  
                                                    name= 'name'
                                                    value={this.state.name} 
                                                    onChange={this.onChange} 
                                                    />

                                                    <h5>Phone</h5>
                                                    <input type='text'
                                                    name= 'phone'
                                                    value={this.state.name}
                                                    onChange={this.onChange}  
                                                            />

                                                            <h5>Profession</h5>
                                                    <input type='text'  
                                                    name= 'profession'
                                                    value={this.state.name} 
                                                    onChange={this.onChange} 
                                                    />

                                                    <h5>Hourly Rate</h5>
                                                    <input type='text'
                                                    name= 'hourlyRate'
                                                    value={this.state.name}
                                                    onChange={this.onChange}  
                                                            />
                                                            <h5>Photo</h5>
                                                    <input type='file'  
                                                    name= 'photo'
                                                    value={this.state.name} 
                                                    onChange={this.onChange} 
                                                    />

                                                    <h5>Availibilty Hrs/Week</h5>
                                                    <input type='text'
                                                    name= 'availibilty'
                                                    value={this.state.name}
                                                    onChange={this.onChange}  
                                                            />
                                                            
                                                    <h5>Age</h5>
                                                    <input type='text'
                                                    name= 'age'
                                                    value={this.state.name}
                                                    onChange={this.onChange}  
                                                            />
                                                                        
                                                    <h5>Address</h5>
                                                    <input type='text'
                                                    name= 'address'
                                                    value={this.state.name}
                                                    onChange={this.onChange}  
                                                            />
                                                
                       </div>
                                            <div className="col2">
                                                <h5>Experience</h5>
                                        <input type='text'  
                                        name= 'experience'
                                        value={this.state.name} 
                                        onChange={this.onChange} 
                                        />

                                        <h5>Github</h5>
                                        <input type='text'
                                        name= 'github'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />

                                                <h5>Behance</h5>
                                        <input type='text'  
                                        name= 'behance'
                                        value={this.state.name} 
                                        onChange={this.onChange} 
                                        />

                                        <h5>Facebook</h5>
                                        <input type='text'
                                        name= 'facebook'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />
                                                <h5>Instagram</h5>
                                        <input type='text'  
                                        name= 'instagram'
                                        value={this.state.name} 
                                        onChange={this.onChange} 
                                        />

                                        <h5>LinkedIn</h5>
                                        <input type='text'
                                        name= 'linkedin'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />
                                                
                                        <h5>Portfolio</h5>
                                        <input type='text'
                                        name= 'portfolio'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />
                                                            
                                        <h5>Address</h5>
                                        <input type='text'
                                        name= 'address'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />
                
                       </div>
                          <div className="col3">
                                                <h5>Description</h5>
                                        <textarea type='text'  
                                        name= 'experience'
                                        value={this.state.name} 
                                        onChange={this.onChange} 
                                        />

                                        <h5>C.V</h5>
                                        <input type='file'
                                        name= 'cv'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />
                                     <h5>Certificates</h5>
                                        <input type='file'
                                        name= 'certificates'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />

                                                <h5>Languages</h5>
                                        <input type='file'  
                                        name= 'languages'
                                        value={this.state.name} 
                                        onChange={this.onChange} 
                                        />

                                        <h5>Skills</h5>
                                        <input type='text'
                                        name= 'skills'
                                        value={this.state.name}
                                        onChange={this.onChange}  
                                                />
                
                       </div>
                        <button type='submit' className='formSubmit'>Submit</button>
                </form>
                </div>
            </div>
        )
    }
}
